确认时间：
体 格 检 查

     体温℃     脉搏次/分    呼吸次/分    血压m mHg
一e般状况: 发育良好，营养中等，神志清楚，体位自主，正常面容，表情安静，查体合作
皮肤黏膜: 颜色正常，温度正常，皮肤弹性良，无水肿，无皮疹，无瘀点，无紫癜，无皮下结节，无肿块，无蜘蛛痣，无肝掌，无溃疡，无瘢痕。

淋 巴 结: 浅表淋巴结未触及肿大。

头部及其器官:
  头颅正常，无肿块，无压痛，无瘢痕，头发，眼睑正常，眼球正常，瞳孔形状等大正圆，直径（左侧2mm，右侧2mm），对光反射正常。巩膜无黄染。双耳无畸形，无分泌物，乳突无压痛，听力正常。鼻无畸形，无出血，无鼻中隔偏曲，鼻窦无压痛。牙齿无异常，牙龈未见异常，口唇颜色红润。舌苔，无溃疡，伸舌方向居中。咽部粘膜未见异常，扁桃体正常，未见充血、分泌物、假膜。喉发音清晰。

颈   部: 运动自如，未见颈静脉怒张，肝颈静脉回流征阴性，颈动脉搏动正常，气管居中，甲状腺未及肿大，质，无压痛，无结节，未触及震颤，未闻及血管杂音。

胸   部: 胸廓外形对称，乳房，无红肿，无溃疡，乳头无凹陷，未触及包块。未见肋间隙，胸壁无静脉曲张、皮下气肿，无胸壁压痛。肺脏和胸膜：双肺呼吸动度，未见增强及减弱，无肋间隙增宽及变窄。语颤,无胸膜摩擦感,无皮下捻发音。呼吸音正常，无啰音。
心脏：心前区无隆起，心尖搏动正常，无心前区震颤和无心包摩擦感。
叩诊心脏浊音界

   右界（cm）           肋间               左界（cm）
          2～3                 Ⅱ                 2～3
          2～3                 Ⅲ                 3.5～4.5
          3～4                 Ⅳ                 5～6
                   Ⅴ                 7～9 左锁骨中线距胸骨中线为8～10cm
心率次/分，心律齐，未闻及杂音，未闻及心包摩擦音。

腹   部: 未触及包块。腹部平坦，未见皮疹、色素、瘢痕、及腹壁静脉曲张。未见局部隆起。腹软，无肌紧张，无压痛，无反跳痛。肝脏未触及，脾脏未触及。肝区叩击痛有，无肾区叩击痛，移动性浊音阴性。肠鸣音正常。未闻及振水音和血管杂音。

肛门、直肠及外生殖器: 未查。
脊   柱: 弯曲度正常，活动度，无压痛，无叩击痛。

四肢及其关节:
  无畸形，无杵状指（趾），无下肢静脉曲张，无下肢水肿,
无骨折及关节红肿、疼痛、压痛、积液、脱臼。足背动脉搏动正常，无肌肉萎缩。
肌力：左侧上肢Ⅰ级，右侧上肢Ⅲ级，左侧下肢Ⅰ级，右侧下肢Ⅳ级，肌张力正常。

神经反射: 浅反射（角膜反射、腹壁反射、提睾反射）正常，深反射（肱二头肌、肱三头肌、膝腱反射、跟腱反射）正常，Hoffmann征阴性，Babinski征阴性，Oppenheim征阴性，Gordon征阴性，Kernig征阴性，Brudzinski征阴性。
